import{_ as e,p as i,q as t,t as p,Z as r,n as l}from"./framework-85e9f276.js";const n={},h=r('<meta name="referrer" content="no-referrer"><h1 id="如何使用" tabindex="-1"><a class="header-anchor" href="#如何使用" aria-hidden="true">#</a> 如何使用</h1><p>我们在文章中嵌入了一些小组件，尝试让我们的文档与用户之间产生交互性。为文档增添更多的乐趣和实用性</p><h2 id="_1-访问文档" tabindex="-1"><a class="header-anchor" href="#_1-访问文档" aria-hidden="true">#</a> 1 访问文档</h2><p>由于国内的网络环境，我们的主站 <a href="alphaalist.xyz">alphaalist.xyz</a> 有可能会因为域名污染重定向到其它的网址或者服务器被墙。所以我们提供了其它站点 <a href="cn.alphaalist.xyz">cn.alphaalist.xyz</a></p><p>这个网页的托管方公司在国内，如果被墙他们也会妥善的修复。因此如果某一天访问不了主站，请访问国内站</p><p>它们的内容是一样的，但是国内站无法正常使用搜索服务（algolia 配置）。我们后续也没有为该站点申请 algolia 文档搜索的计划。内容同步会晚于主站，但不影响正常访问</p><h2 id="_2-听会音乐" tabindex="-1"><a class="header-anchor" href="#_2-听会音乐" aria-hidden="true">#</a> 2 听会音乐</h2><p>我们在文档中嵌入了一个音乐播放器（heomusic），您可以在顶部的 <code>navbar</code> 中点击音乐切换到播放器页面</p><p><img src="https://image.alphaalist.xyz/听音乐.png" alt="听音乐"></p><p>点开后音乐播放器会随机选一首歌播放，还是相当好玩的功能对吧</p><p><img src="https://image.alphaalist.xyz/音乐界面.png" alt="音乐界面"></p><h2 id="_3-运行代码" tabindex="-1"><a class="header-anchor" href="#_3-运行代码" aria-hidden="true">#</a> 3 运行代码</h2><p>得益于 <code>vuepress-plugin-md-enchance</code> 插件，我们在文档中成功嵌入了 replit 在线代码编辑器。需要注意的是，受限于网络环境，加载时间可能会较长。因为 replit 是一个外国的网站</p><p><img src="https://image.alphaalist.xyz/replit界面.png" alt="replit界面"></p><p>点击 <code>Run</code> 就可以运行代码，由于这篇文档是公益性的，所以我尽可能的减少成本，<code>replit</code> 的服务器没付费只有 2 核。因此运行代码可能需要排队</p><p><img src="https://image.alphaalist.xyz/replit界面.png" alt="replit运行"></p><p>我们有在认真改善这一缺陷，如果您愿意支持我们，我们也愿意购买一台独立的云服务器提供完善的国内代码编辑服务。亦或者从 SmallPigPig 的私有服务器中腾出资源</p><div align="center"><img src="https://image.alphaalist.xyz/收款码.png" width="400"></div><p>您可以在下方体验 replit 组件，可能需要一点时间</p>',20);function s(c,d){const a=l("Replit");return i(),t("div",null,[h,p(a,{user:"ShiYiZhiHanZhuZ",repl:"Zi-Fu-Chuan-Shu-Ju-Lei-Xing-Zhuan-Huan",file:"main.py"})])}const m=e(n,[["render",s],["__file","use.html.vue"]]);export{m as default};
